\n–î–∏–∑–∞–π–Ω:\r\n\r\nMotion design, WEB –∏ –Ω–µ —Ç–æ–ª—å–∫–æ!\r\n\r\n–û–ø—ã—Ç —Ä–∞–±–æ—Ç—ã –±–æ–ª–µ–µ 7 –ª–µ—Ç, –æ–ø—ã—Ç –Ω–∞ —Ä—ã–Ω–∫–µ –±–æ–ª–µ–µ 5! \r\n\r\n–í–ª–∞–¥–µ–Ω–∏—è —Ç–µ—Ö–Ω–æ–ª–æ–≥–∏—è–º–∏ –∫–∞–∫:\r\n- UI | UX \r\n- 3D MAX \r\n- Figma\r\n- Sketch\r\n–ò –º–Ω–æ–≥–∏–µ –¥—Ä—É–≥–∏–µ !!!\r\n\r\nFront-end (—Ñ—Ä–æ–Ω—Ç)\r\n\r\n–¢—É—Ç –∞–∂ —Ü–µ–ª—ã—Ö 4 –º–∞—Å—Ç–µ—Ä–∞ —Å–ø–µ—à–∞—â–∏—Ö –≤–∞–º –ø–æ–º–æ—á—å !!!\r\n\r\n- Junior Developer\r\n- Middle  Developer\r\n- Midle++ Developer\r\n- Senior Developer\r\n\r\n–û–ø—ã—Ç –∏ —Å—Ç–∞–∂ —ç—Ç–∏—Ö –ª—é–¥–µ–π –Ω–∞—á–∏–Ω–∞–µ—Ç—Å—è –æ—Ç 2 –ª–µ—Ç –¥–æ 8 ü§ó\r\n\r\n–í–ª–∞–¥–µ—é—Ç —Ç–∞–∫–∏–º–∏ —Ç–µ—Ö–Ω–æ–ª–æ–≥–∏—è–º–∏ —Ä–∞–±–æ—Ç—ã –∫–∞–∫:\r\n- HTML5\r\n- CSS3\r\n- W3C\r\n- jQuery\r\n- Bootstrap \r\n- JavaScript\r\n- Vue.js\r\n- React.js\r\n- Meteor.js\r\n\r\n–ê —Ç–∞–∫ –∂–µ:\r\n‚öôÔ∏è–ê–¥–∞–ø—Ç–∏–≤–Ω–æ—Å—Ç—å\r\n‚öôÔ∏è–ú–∏–Ω–∏–º—É–º –∫–æ–¥–∞\r\n‚öôÔ∏è–í—ã—Å–æ–∫–∞—è —Å–∫–æ—Ä–æ—Å—Ç—å –∑–∞–≥—Ä—É–∑–∫–∏ —Å—Ç—Ä–∞–Ω–∏—Ü\r\n‚öôÔ∏è–°–µ–º–∞–Ω—Ç–∏—á–Ω–æ—Å—Ç—å\r\n‚öôÔ∏è–í–∞–ª–∏–¥–Ω–æ—Å—Ç—å\r\n\r\nBack-end (–ë—ç–∫)\r\n\r\n–ê —Ç—É—Ç —É –Ω–∞—Å –≤—Å–µ —Å–µ—Ä—å—ë–∑–Ω–µ–µ –∏ –∫—Ä–æ–ø–æ—Ç–ª–∏–≤–µ–µ.... 3 —Å–ø–µ—Ü–∏–∞–ª–∏—Å—Ç–∞ –≤—ã—Å—à–µ–≥–æ —É—Ä–æ–≤–Ω—è –∫ –≤–∞—à–µ–º—É —Ä–∞—Å–ø–æ—Ä—è–∂–µ–Ω–∏—é  !!!\r\n\r\n- Middle Devloper\r\n- Middle++ Developer\r\n- Senior Developer\r\n\r\n–û–ø—ã—Ç –∏ —Å—Ç–∞–∂ —ç—Ç–æ–π  ¬´—Ç—Ä–æ–∏—Ü—ã¬ª –Ω–∞—á–∏–Ω–∞–µ—Ç—Å—è –æ—Ç 5 –ª–µ—Ç –¥–æ 8 ü§ù\r\n\r\n–í–ª—é–±–ª–µ–Ω—ã –≤  —Å–≤–æ–∏—Ö ¬´–ª—é–±–∏–º—ã—Ö¬ª  :\r\n\r\n- PHP\r\n- Laravel\r\n- Phalcon\r\n- RUBY\r\n- Phyton\r\n- C#\r\n–ê —Ç–∞–∫ –∂–µ:\r\nüîß SQL\r\nüîß Mysqli\r\nüîßMongo\r\nüîßXML \r\n\r\n–ò –º–Ω–æ–≥–∏–µ –¥—Ä—É–≥–∏–µ!!!\r\n\r\n–ü—Ä–æ–¥–≤–∏–∂–µ–Ω–∏–µ:\r\n\r\nüëë–ú–∞—Ä–∫–µ—Ç–æ–ª–æ–≥/–¢–∞—Ä–≥–µ—Ç–æ–ª–æ–≥/SMM - —ç—Ç–æ—Ç —á–µ–ª–æ–≤–µ–∫ –¥–µ–ª–∞ –∑–Ω–∞—é—â–∏–π –∏ –ª—é–±—è—â–∏–π —Å–≤–æ—é —Ä–∞–±–æ—Ç—É –∏ –¥–µ–ª–æ –∂–∏–∑–Ω–∏ !!! \r\n\r\n–û–ø—ã—Ç —Ä–∞–±–æ—Ç—ã –∫–∞–∫ —Å —Ä–µ–∫–ª–∞–º–Ω—ã–º–∏ –∞–≥–µ–Ω—Å—Ç–≤–∞–º–∏ —Ç–∞–∫ –∏ —Å –ª—é–±—ã–º–∏ —Ç–∏–ø–∞–º–∏ —Å–æ—Ü–∏–∞–ª—å–Ω—ã—Ö —Å–µ—Ç–µ–πüåü\r\n\r\n–í–ª–∞–¥–µ—é—â–∏–π —Ç–∞–∫–∏–º–∏ —Ç–µ—Ö–Ω–æ–ª–æ–≥–∏—è–º–∏ –∏ –∑–Ω–∞–Ω–∏—è–º–∏ –∫–∞–∫:\r\n\r\n- –¢–∞—Ä–≥–µ—Ç–∏—Ä–æ–≤–∞–Ω–Ω–∞—è  —Ä–µ–∫–ª–∞–º–∞\r\n- –†–µ—Ç–∞—Ä–≥–µ—Ç–∏–Ω–≥\r\n- –ì–µ–æ —Ç–∞—Ä–≥–µ—Ç\r\n- SEO\r\n- SMM\r\n- –ù–µ–π—Ä–æ–º–∞—Ä–∫–µ—Ç–∏–Ω–≥\r\n\r\n–ò–Ω–¥–∏–≤–∏–¥—É–∞–ª—å–Ω—ã–π –ø–æ–¥—Ö–æ–¥ –∫ –∫–∞–∂–¥–æ–º—É –∏ –Ω–∞—Ö–æ–∂–¥–µ–Ω–∏–µ –≤ –ª—é–±—ã—Ö —Å–∏—Ç—É–∞—Ü–∏–π –∏—Å—Ç–∏–Ω–Ω–æ–≥–æ –ø—É—Ç–∏ –∏ —Ä–µ—à–µ–Ω–∏—è –ª—é–±—ã—Ö –ø—Ä–æ–±–ª–µ–º üòä',1,'2019-10-25 08:18:08','2019-10-25 09:04:01');
